def PrivateKeyAtIndex(i):
	return struct.pack("<L", i + 1) + b'\x00'*28
def IndexForPrivateKey(privateKey):
	result = struct.unpack("<L", privateKey[:4])[0]-1
	if not PrivateKeyAtIndex(result) == privateKey:
		return None
	assert PrivateKeyAtIndex(result) == privateKey
	return result
def GetKeyPair(i):
	privateKey = PrivateKeyAtIndex(i)
